import { Card, Button, Container } from 'react-bootstrap';
import '../Estilos/Produto.css';

export default function Produto(props) {
    return (
        <Card className={props.categoria + " col-lg-3 col-md-4 col-sm-6 col-xs-12 shadow-sm p-3 mb-5 bg-white rounded"}>
            <Card.Img src={require(`./imgs/geladeira1.png`).default} variant="top" alt ="Imagem do produto" />
            <Card.Body>
                <Card.Title className="nome-produto">{props.nome}</Card.Title>
                <Card.Text className="preco-antigo">R$ {props.preco}</Card.Text>
                <Card.Text className="preco-novo">R$ {props.precoVenda}</Card.Text>
                <Button variant="success" type="button" href="#" block>Confira</Button>
            </Card.Body>
        </Card>
    )
}
